import React from 'react'
import GridLayout from 'react-grid-layout';

import GridElement from './GridElement';

export default class Grid extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <div>
        <GridLayout className="layout" layout={this.props.layout} cols={12} rowHeight={30} width={1200}>
          {
            this.props.layout.map(elem => {
              return <GridElement selected={x.i === this.props.selected} id={elem.i} />
            })
          }
        </GridLayout>
      </div>
    )
  }
}
